import React, { Component } from 'react';
import { Row } from 'antd';

class login extends Component {
    constructor(props) {
        super(props);
        
    }
    
    render() {
        return (
            <div className="login">
                <Row>
                    <div>
                        logo area
                    </div>
                    <div>
                        form area
                    </div>
                </Row>
            </div>
        );
    }
}

export default login;
